  true,\n\t\"url\": null,\n\t\"notes\": \"Estimates for each of the 50 states and
  the entire United States showing the windy land area with a gross capacity factor
  (without losses) of 30% and greater at 80-m height above ground and the wind energy
  potential from development of the u201cavailableu201d windy land area after exclusions.
  \ The u201cInstalled Capacityu201d shows the potential megawatts (MW) of rated capacity
  that could be installed on the available windy land area, and the u201cAnnual Generationu201d
  shows annual wind energy generation in gigawatt-hours (GWh) that could be produced
  from the installed capacity.  AWS Truewind, LLC developed the wind resource data
  for [windNavigator](http://navigator.awstruewind.com/) with a spatial resolution
  of 200 m.  NREL produced the estimates of windy land area and windy energy potential,
  including filtering the estimates to exclude areas unlikely to be developed such
  as wilderness areas, parks, urban areas, and water features (see the \"Wind Resource
  Exclusion Table\" sheet within the Excel file for more detail).\",\n\t\"license_title\":
